package pms.z01_vo;

public class Temp {
	private String name;
	private int age;

	public Temp() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Temp(String name, int age) {
		super();
		this.name = name;
		this.age = age;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public int getAge() {
		return age;
	}

	public void setAge(int age) {
		this.age = age;
	}

}
